import { useEffect, useState } from "react";

const Home = () => {
    const [slots, setSlots] = useState(null);
    useEffect(() => {
        const fetchSlots = async () => {
            const response = await fetch('localhost:4000/api/slots')
            const json = await response.json();

            if (response.ok) {
                setSlots(json);
            }
        }

        fetchSlots();
    }, []);
    return (
        <div className="Home">
            <div className="slots">
                {slots && slots.map((slot) => (
                    <p key={slot._id}>{slot.module}</p>
                ))}
            </div>
        </div>
    )
}

export default Home;
